        body {

        }
        header {
            display: flex;
            justify-content: space-between;
            align-items: center;

            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.5);
        }
        .centerhead {
            position: center;
        }
        .centerhead h1 {
            font-size: 2rem;
            text-align: center;
        }
        .title {
            font-size: 1.5rem;
            font-weight: bold;
        }
        .containers {
            display: grid;
            grid-template-columns: repeat(2, 1fr);
            gap: 20px;
        }
        .all {
            background-color: rgba(30, 30, 30, 0.5); /* Dark blue */
            color: white;
            width: 90%;
            border-radius: 5px;
            position: fixed;
            z-index: 1000;
            right: 5%;
        }

        /* Top Bar */
        .top-bar {
            background-color: rgba(0, 0, 0, 0);
            color: white;
            padding: 15px 20px;
            display: flex;
            justify-content: space-between;
            align-items: center;
            position: relative;
        }

        .left-side {
            display: flex;
            align-items: center;
        }

        .logo {
            width: 30px;
            height: 30px;
            margin-right: 10px;
        }

        .title {
            font-size: 18px;
            font-weight: bold;
        }

        /* Menu Icon */
        .menu-icon {
            font-size: 24px;
            transition: transform 0.3s ease-in-out;
        }

        /* Dropdown Menu (Hidden by Default) */
        .menu-container {
            top: 100%;
            left: 0;
            width: 100%;
            background-color: rgb(0, 0, 0, 0);
            text-align: center;
            overflow: hidden;
            height: 0;
            transition: height 0.3s ease-in-out, opacity 0.3s ease-in-out;
            opacity: 0;
        }

        .menu-items {
            display: flex;
            flex-direction: column;
            padding: 10px 0;
            background-color: rgb(0, 0, 0, 0);
        }

        .menu-items a {
            padding: 10px;
            text-decoration: none;
            color: white;
            display: block;
            background-color: rgb(0, 0, 0, 0);
            transition: color 0.5s ease;
        }

        .menu-items a:hover {
            color: rgba(0, 0, 255, 1);
        }

        .menu-container.expand {
            height: 90px; /* Adjust height based on number of items */

        .rotating {
            transform: rotate(90deg);
        }

        }
        .main img {
            width: 15%;
            height: auto;
            border-radius: 8px;
            margin-bottom: 1rem;
        }
        .main h1 {
            font-size: 3rem;
            margin-bottom: 1rem;
        }
        .main p {
            font-size: 1.2rem;
            margin-bottom: 2rem;
        }
        .main a.button {

            color: #fff;
            background-color: #7a00ff;
            padding: 1rem 2rem;
            border-radius: 8px;
            font-size: 1.2rem;
            transition: background 1s ease;
        }
        .main a.button:hover {
            background-color: #e300ff;
        }
        .main.show {
            opacity: 1; /* Fade in */
            transform: translateY(0); /* Move to original position */
        }
        footer {
            text-align: center;
            width: 90%
            background-color: #000000;
            padding: 1.3rem 0;
            font-size: 0.9rem;
            color: #aaa;

            margin: 2rem auto;
            width: auto;
            max-width: 400px;
            height: 250px;
            background-color: rgba(20, 20, 50, 0.3); /* Blue background and shit */
            border: 1px solid #555; /* Border */
            border-radius: 5px;
            box-shadow: 0 4px 10px rgba(0, 0, 0, 0.5);
            padding: 1rem;
            overflow: hidden;
            text-align: center; /* Center-align text */

        }

            color: #ffffff;
        }
        .image-container .description {
            font-size: 1.2rem;
            line-height: 1.5;
            color: #ddd;
        }
